- input: "TEXT\x1CC00358663\x1C91a76aea-d7a6-4306-b\x1C\x1CF3XA\x1CThis amendment
    is being filed in response to the March 18, 2009 letter from the Commission regarding
    ARDA-ROC PAC's (the PAC) 2008 Post-General Report (10/16/08-11/24/08).  The letter
    requests additional information pertaining to a $3,000 offset to operating expenditures
    reported by the PAC.  On October 28, 2007, the PAC made a payment in the amount
    of $50,000 to the D.C. Arena.  This payment was made for use of a box at the Verizon
    Center in Washington, DC.  The PAC reported this expenditure on Line 21 of its
    2007 Year-End Report.  In November 2008, the PAC made the box available to the
    New Democrat Coalition (NDC) for a fundraising event sponsored by NDC to benefit
    NDC.  The cost of the box was $8,000 plus food and beverages.  The PAC made an
    in-kind contribution in the amount of $5,000 to NDC in connection with this event.
    \ NDC paid to the PAC $3,000, which amount represents the difference in the cost
    of the box ($8,000) and the in-kind contribution made by the PAC to NDC ($5,000).
    \ NDC paid the cost of the food and beverages directly to the vendor. The $3,000
    received by the PAC from NDC was reported by the PAC as an offset to an operating
    expenditure, which operating expenditure was the original payment made to the
    D.C. Arena.\n"
